import FilterCard from './FilterCard'
import './Filter.css'

function Filter() {
  return (
    <section id='filterSection'>
      <p>Filters:</p>
      <div className='filtersHolder'>
        <FilterCard/>
        <FilterCard id='Java'/>
      </div>
    </section>
  );
}

export default Filter;
